pragma solidity ^0.7.1;
//SPDX-License-Identifier: UNLICENSED

import "./Interfaces/ITrustAnchorStorage.sol";
import "./Interfaces/ITrustAnchorManager.sol";
import "./Interfaces/IShyftCacheGraph.sol";

import "./ECRecovery.sol";
import "./Administrable.sol";
import "./DataModels/DMTrustAnchor.sol";

/// @author Chris Forrester, 2018+ Shyft. all rights reserved.

/// @dev
/// | The Trust Anchor Storage is the contract responsible for maintaining the chain-of-custody for all of the attestations on the Shyft Core architecture.
/// | The primary design goals are to concentrate attestations into individual accounts, with the responsibility of maintenance of those attestations belonging to the Trust Anchors that has initially posted those attestations.
/// | To prevent attestation "spam" (invalid attestations that end-users don't agree with), there is a signature provided by both the Trust Anchor and the end-user.
/// | After attestation (prior to signatures), the connected Cache Graph contract can be used to map users to Trust Channels (which are the higher level connectivity to the Trust Anchor network) in an "un-consented" manner, after signatures, the Cache Graph can be used to map users to "consented" Trust Channels.
/// |
/// | There are two ways of managing who provides the permissions for the act of data retrieval.
/// | One mechanism is a Managed context, where the end-user is giving permission to the Trust Anchor to fully manage the act of data transmission and retrieval on the user's behalf.
/// | The other mechanism is an Un-managed context, where the end-user is the only entity that has permission to allow data transmission from the source Trust Anchor (that has provided the initial attestation) to another Trust Anchor.
/// |
/// | The contents of the attestation consist of:
/// | 1. The end user's smart contract address that is being attested to.
/// | 2. The jurisdiction of the attestation (may be different than the Trust Anchor's jurisdiction).
/// | 3. The effective (start) time of the attestation (in Seconds from Unix Epoch Time).
/// | 4. The expiry time of the attestation (in Seconds from Unix Epoch Time).
/// | 5. Any non-PII public metadata (hash codes from the Trust Anchor, etc.)
/// | 6. The document matrix, a series of 0's and 1's corresponding to the availability of specific pieces of "hard" documentation that the Trust Anchor holds. Generally encrypted via symmetric AES to prevent abstracted PII from being leaked on the blockchain directly.
/// | 7. The availability address, an ethereum-type address corresponding to the smart contract that manages the various economic & regulatory conditions of data transfer from a Trust Anchor to a data retriever. Generally encrypted via symmetric AES to prevent abstracted PII from being leaked on the blockchain directly.
/// | 8. Whether this attestation is managed by the Trust Anchor. This indicates that consent conditions are applied from the Trust Anchor instead of the end user.
/// |
/// | Administrators of this contract are able to be set in order to allow for better management practices, with multi-signature support from the Administrable contract.

contract TrustAnchorStorage is Administrable, ITrustAnchorStorage, DMTrustAnchor {
    //@note: due to https://github.com/trufflesuite/truffle-contract/issues/8
    // events will not log from called contracts (in the attestation revocation call for instance).
    // this allows for debugging internally.
//    event EVT_UpdatingCacheGraph(address _identifiedAddress,
//        uint16 updateLength,
//        uint16 oldAttestationKeccakArrayLength,
//        uint16 attestationKeccakArrayLength);
//    event EVT_DoCompileCacheGraph(address _identifiedAddress,
//        uint32 i,
//        uint16 idx);
//    event EVT_DoConditionallyRemoveTrustChannelEXBitFields(address _identifiedAddress,
//        uint32 trustAnchorIndex,
//        bytes32 keccakHash);
//    event EVT_GotAttestationStatus(address _identifiedAddress,
//        bool attestationStatusApproved,
//        bool didChangeApprovedStatus,
//        uint16 attestationIndex,
//        bool attestationHasAlreadyBeenProcessed);
//    event EVT_CompareTime(uint256 _effectiveTime,
//        uint256 blockTimestamp,
//        uint256 _expiryTime,
//        bool isActive);
//    event EVT_DoCompileCacheGraphTrustChannelEXBitFields(address _identifiedAddress,
//        bytes32 keccakHash,
//        bool consentAvailable);
//    event EVT_GetActiveTrustChannelEXBitFieldLength(uint24 senderHighestSubmapNumber,
//        uint24 receiverHighestSubmapNumber,
//        uint256 senderBitfield,
//        uint256 receiverBitfield,
//        uint256 andedBitField);
//    event EVT_GotBitFieldFromTrustAnchor(address trustAnchorAddress,
//        uint32 trustAnchorIndex,
//        uint256 bitField);

    //debug from TrustAnchorManager
//    event EVT_isPrimeRevocationManager(address shyftConduitAddress, address _address);


    //debug from ShyftCacheGraph
//    event EVT_TrustChannelBitFieldWords(uint32 bitFieldWords);
//    event EVT_TrustChannelBitFieldIndex(uint16 trustChannelIndex);
//    event EVT_TrustChannelBitFieldIndexEXT(uint32 index,
//        uint32 shifter,
//        uint32 trustChannelBitFieldWord,
//        uint256 trustChannelBitField,
//        uint16 trustChannelIndex);
//
//    event EVT_GotHighestSubmapNumbers(uint24 senderHighestSubmapNumber,
//        uint24 receiverHighestSubmapNumber);
//
//    event EVT_GotLowestAndHighestTrustChannelSubmapNumber(uint24 lowestTrustChannelSubmapNumber,
//        uint24 highestTrustChannelSubmapNumber);
//
//    event EVT_TrustChannelRouted(uint24 trustChannelIndex,
//        address _senderIdentifiedAddress,
//        address _receiverIdentifiedAddress);

    /// @dev Event for the setting of an attestation.
    event EVT_setAttestation(bytes32 attestationKeccak,
        address msg_sender,
        address _identifiedAddress,
        uint16 _jurisdiction,
        uint256 _effectiveTime,
        uint256 _expiryTime,
        bytes32 _publicData_0,
        bytes32 _documentsMatrixEncrypted_0,
        bytes32 _availabilityAddressEncrypted,
        bool _isManaged,
        uint256 _publicDataLength,
        uint256 _documentsMatrixEncryptedLength);

    /// @dev Event for an attestation already existing when attempting setAttestation.
    event EVT_AttestationAlreadyExists(address sender, address _identifiedAddress, bytes32 attestationKeccak);
    /// @dev Event for an attestation not being valid when attempting setAttestation.
    event EVT_AttestationNotValid(address sender, address _identifiedAddress, bytes32 attestationKeccak, uint256 _publicDataLength, uint256 _documentsMatrixEncryptedLength, uint256 _availabilityAddressEncryptedLength);

    /// @dev Event for the revoking of an attestation.
    event EVT_REQ_revokeAttestation(address msgSender, bytes32 _attestationKeccak);
    /// @dev Event for the re-enabling of an attestation.
    event EVT_REQ_reenableAttestation(bytes32 _attestationKeccak);

    /// @dev Event for the main phase of the revocation process
    event EVT_revokeAttestation(bytes32 _attestationKeccak,
        address trustAnchorAddress,
        uint16 keccakArrayIndex,
        bool isMsgSenderPrimeRevocationManager);

    /// @dev Event for the recompilation phase of the revocation process
    event EVT_revokeAttestationDoRecompile(address shyftCacheGraphAddress);

    /// @dev Event for enabling the data retrieval in a Managed context.
    event EVT_enabledDataRetrievalManaged(address sender, bytes32 _attestationKeccak, address _dataRetrievalTarget, bytes _documentsRetrievalConsentedEncrypted);
    /// @dev Event for enabling the data retrieval in a Un-managed context.
    event EVT_enabledDataRetrievalUnmanaged(address sender, bytes32 _attestationKeccak, address _dataRetrievalTarget, bytes _documentsRetrievalConsentedEncrypted);

    /// @dev Event for revoking the data retrieval in a Managed context.
    event EVT_revokedDataRetrievalManaged(address sender, bytes32 _attestationKeccak, address _dataRetrievalTarget);
    /// @dev Event for revoking the data retrieval in an Un-managed context.
    event EVT_revokedDataRetrievalUnmanaged(address sender, bytes32 _attestationKeccak, address _dataRetrievalTarget);

    /// @dev Event for a User setting their data retrieval revenue share in respect to a Trust Anchor.
    event EVT_userSetDataRetrievalRevenueShare(address identifiedAddress, address _trustAnchorAddress, uint32 _dataSharePercentage);

    /// @dev Event for a data retrieval entity (receiving a user's pii data) to confirm that they have validated that the pieces of data sent from the source Trust Anchor are consistent with the data retrieval parameters.
    event EVT_dataRetrievalEntityHasValidatedAttestation(bytes32 _attestationKeccak);


    /// @dev Mapping of the attestation keccak hash to the data model of the attestation, which would contain all pertinent properties of an attestation.
    mapping(bytes32 => trustAnchorAttestation) attestationKeccak_to_attestation;

    /// @dev Mapping of the Trust Anchor address to the attestation keccak array that they have set.
    mapping(address => bytes32[]) trustAnchorAddress_to_attestationKeccakArray;

    /// @dev Mapping of the attestation keccak hash to the identified address (end user)'s address that is associated with this attestation originally.
    mapping(bytes32 => address) attestationKeccak_to_identifiedAddress;
    /// @dev Mapping of the identified address (end user)'s address to the associated attestation array.
    mapping(address => bytes32[]) identifiedAddress_to_attestationKeccakArray;

    /// @dev Mapping of the attestation keccak hash to the Index in the identified address (end user)'s attestation array.
    mapping(bytes32 => uint16) attestationKeccak_to_identifiedAddressAttestationKeccakArrayIndex;

    /// @dev Mapping of the mapping of the end-users relation between themselves, their pii-maintaining trust anchor, and their current data revenue share.
    mapping(address => mapping(address => uint32)) identifiedAddress_to_trustAnchor_to_dataRetrievalRevenueShare;

    /// @dev Address for the Trust Anchor Manager that is linked to this contract.
    address public trustAnchorManagerAddress = address(0);

    /// @dev Address for the Shyft Cache Graph that is linked to this contract.
    address public shyftCacheGraphAddress = address(0);

    /// @dev Initializes Trust Anchor Storage with the owner set to the calling public address.

    constructor() {
        owner = msg.sender;
    }

    /// @param _trustAnchorManagerAddress The smart contract address for the Trust Anchor Manager that should be linked.
    /// @dev | Links Trust Anchor Manager to this contract's function flow.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0: not an administrator
    ///    | 1: not enough administrators have permissioned change
    ///    | 2: set trust anchor manager address

    function setTrustAnchorManagerAddress(address _trustAnchorManagerAddress) public returns (uint8 result) {
        require(_trustAnchorManagerAddress != address(0));

        if (isAdministrator(msg.sender)) {
            bytes32 keyKeccak = keccak256(abi.encodePacked("trustAnchorManagerAddress", _trustAnchorManagerAddress));

            uint256 numPermissions = getPermissionsForMultisignKey(keyKeccak);

            bool permittedToModify;

            if (numPermissions >= adminConfirmationThreshold) {
                permittedToModify = true;
            } else {
                uint256 numConfirmedPermissions = adminApplyAndGetPermissionsForMultisignKey(keyKeccak);

                if (numConfirmedPermissions >= adminConfirmationThreshold) {
                    permittedToModify = true;
                }
            }

            if (permittedToModify == true) {
                trustAnchorManagerAddress = _trustAnchorManagerAddress;

                adminResetPermissionsForMultisignKey(keyKeccak);

                // trust anchor set
                return 2;

            } else {
                // not enough administrators have permissioned change
                return 1;
            }
        } else {
            // not an administrator
            return 0;
        }
    }

    /// @param _shyftCacheGraphAddress The smart contract address for the Shyft CacheGraph that should be linked.
    /// @dev | Links a Shyft Cache Graph to this contract's function flow.
    ///      | Uses Multi-signature permissions.
    /// @return result
    ///    | 0: not an administrator
    ///    | 1: not enough administrators have permissioned change
    ///    | 2: set shyft cache graph address

    function setShyftCacheGraphAddress(address _shyftCacheGraphAddress) public returns (uint8 result) {
        require(_shyftCacheGraphAddress != address(0));

        if (isAdministrator(msg.sender)) {
            bytes32 keyKeccak = keccak256(abi.encodePacked("shyftCacheGraphAddress", _shyftCacheGraphAddress));

            uint256 numPermissions = getPermissionsForMultisignKey(keyKeccak);

            bool permittedToModify;

            if (numPermissions >= adminConfirmationThreshold) {
                permittedToModify = true;
            } else {
                uint256 numConfirmedPermissions = adminApplyAndGetPermissionsForMultisignKey(keyKeccak);

                if (numConfirmedPermissions >= adminConfirmationThreshold) {
                    permittedToModify = true;
                }
            }

            if (permittedToModify == true) {
                shyftCacheGraphAddress = _shyftCacheGraphAddress;

                adminResetPermissionsForMultisignKey(keyKeccak);

                // trust anchor set
                return 2;

            } else {
                // not enough administrators have permissioned change
                return 1;
            }
        } else {
            // not an administrator
            return 0;
        }
    }

    // ** attestations caching and management ** //

    /// @param _trustAnchorAddress The smart contract address that is checked for Verified status.
    /// @dev | Checks whether a Trust Anchor is verified, using a public address. Uses the Trust Anchor Manager linkage to return results.
    /// @return result
    ///    | false = not verified
    ///    | true = is verified

    function isTrustAnchorVerified(address _trustAnchorAddress) internal view returns (bool result){
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        if (trustAnchorManager.isTrustAnchorVerified(_trustAnchorAddress)) {
            //verified address
            return true;
        } else {
            //address not verified
            return false;
        }
    }

    //@reference: for remix input
    //"0x405346187a971f064f33a8e1368bb86dbf054368", "0x85d14957f6d70b3b3921a460e12b5c88186e44ef", 12, 0, 0, "gdageagsgc", "rtryrturuyrt", "0xe0b59a365a026b8ce1524e5b1f293effd626b380", "0xe0b59a365a026b8ce1524e5b1f293effd626b380"
    //"0x405346187a971f064f33a8e1368bb86dbf054368", "0x85d14957f6d70b3b3921a460e12b5c88186e44ef", 12, 0, 0, "", "", "0xe0b59a365a026b8ce1524e5b1f293effd626b380", "0xe0b59a365a026b8ce1524e5b1f293effd626b380"

    //@note:@todo:@next:@here: maybe adding in coinflip-blinding around specific data fields & hence total kyc level would make sense.
    // so it'd turn into a statistically relative level that could be attested to, without revealing the exact dimensionality of the
    // individual's data.

    //@note:@todo:@next:@here: it might be useful to add another field here of what the trust anchor's address
    // is. That way, a mapping could be made by another trust anchor's source.
    //
    // The main issue with this is that the act of baking the trust anchor's trust channels requires the
    // trust anchor's signature.

    /// @param _identifiedAddress The end user's smart contract address that is being attested to.
    /// @param _jurisdiction The jurisdiction of the attestation (may be different than the Trust Anchor's jurisdiction).
    /// @param _effectiveTime The effective (start) time of the attestation (in Seconds from Unix Epoch Time).
    /// @param _expiryTime The expiry time of the attestation (in Seconds from Unix Epoch Time).
    /// @param _publicData Any non-PII public metadata (hash codes from the Trust Anchor, etc.)
    /// @param _documentsMatrixEncrypted The document matrix, a series of 0's and 1's corresponding to the availability of specific pieces of "hard" documentation that the Trust Anchor holds. Generally encrypted via symmetric AES to prevent abstracted PII from being leaked on the blockchain directly.
    /// @param _availabilityAddressEncrypted The availability address, an ethereum-type address corresponding to the smart contract that manages the various economic & regulatory conditions of data transfer from a Trust Anchor to a data retriever. Generally encrypted via symmetric AES to prevent abstracted PII from being leaked on the blockchain directly.
    /// @param _isManaged Whether this attestation is managed by the Trust Anchor. This indicates that consent conditions are applied from the Trust Anchor instead of the end user.
    /// @dev | Sets an attestation for a specific Shyft end-user, sent by a (Verified) Trust Anchor.
    ///      | Contains all the information required to perform a lookup for the "hard" or "light" identity, via the "document matrix", as defined in the Shyft Bluepaper [ insert website link here ].
    ///      | The "availability address" is a public address that contains the smart contract code for dealing with escrows for identity payment, restrictions, regulatory rules etc.
    ///      | Symmetric AES encryption is a preferable way of encoding the "document matrix" and the "availability address", as these could contain (maximally) abstracted PII in the form of bit fields containing the documents that can be retrieved.
    ///      | Given the nature of smart contract operation, any subsequent updates that rely on "effectiveTime" and "expiryTime" will need further calls to update the Shyft Cache Graph for full status updates within the Shyft Core architecture flow regarding the current validity of attestations to end-user's accounts.
    /// @notice _documentsMatrixEncrypted *must* have a bytes length of > 0, public data *can* have bytes length = 0.
    /// @return result
    ///               | 0 =  trust anchor is not verified
    ///               | 1 =  attestation not valid
    ///               | 2 =  attestation already exists
    ///               | 3 =  attestation set (returns resultAttestationKeccak != 0)
    /// @return resultAttestationKeccak resultant keccak hash of the attestation. used for further referencing within the shyft core architecture.

    //@note:@todo:@next: add block number so that cachegraph updates can wait for N blocks
    function setAttestation(address _identifiedAddress,
                            uint16 _jurisdiction,
                            uint64 _effectiveTime,
                            uint64 _expiryTime,
                            bytes memory _publicData,
                            bytes memory _documentsMatrixEncrypted,
                            bytes32 _availabilityAddressEncrypted,
                            bool _isManaged) public override returns (uint8 result, bytes32 resultAttestationKeccak) {
        if (isTrustAnchorVerified(msg.sender)) {
            // Notes on Keccak hash:
            // the bitmap from the _documents is used
            // so is the nonce (first 8 bit unsigned int) from the publicData field.

            bytes32 attestationKeccak;

            if (_publicData.length > 0 && _documentsMatrixEncrypted.length > 0) {
                attestationKeccak = keccak256(abi.encodePacked(
                                                msg.sender,
                                                _identifiedAddress,
                                                _jurisdiction,
                                                _effectiveTime,
                                                _expiryTime,
                                                bytes32(_publicData[0]),
                                                bytes32(_documentsMatrixEncrypted[0]),
                                                _availabilityAddressEncrypted,
                                                _isManaged));
            } else if (_documentsMatrixEncrypted.length > 0) {
                attestationKeccak = keccak256(abi.encodePacked(
                                                msg.sender,
                                                _identifiedAddress,
                                                _jurisdiction,
                                                _effectiveTime,
                                                _expiryTime,
                                                bytes32(_documentsMatrixEncrypted[0]),
                                                _availabilityAddressEncrypted,
                                                _isManaged));
            }

            bool verificationStatus = verifyAttestationValidity(attestationKeccak,
                                                                _identifiedAddress,
                                                                _documentsMatrixEncrypted,
                                                                _availabilityAddressEncrypted);

            if (verificationStatus == true) {
                //@note: @checkwhenupdating: for reference
                // address attestorAddress;

                // address identifiedAddress;
                // uint16 jurisdiction;
                // uint64 effectiveTime;
                // uint64 expiryTime;
                // bytes publicData;

                // bytes documentsMatrixEncrypted;
                // bytes32 availabilityAddressEncrypted;

                // bytes32 trustAnchorPublicAddressEncrypted;

                //make sure the attestation has not been set for this identifiedAddress yet.
                if (attestationKeccak_to_identifiedAddress[attestationKeccak] == address(0)) {
                    //set the main attestation in storage
                    createAttestation(  attestationKeccak,
                                        msg.sender,
                                        _identifiedAddress,
                                        _jurisdiction,
                                        _effectiveTime,
                                        _expiryTime,
                                        _publicData,
                                        _documentsMatrixEncrypted,
                                        _availabilityAddressEncrypted,
                                        _isManaged);

                    //add the attestation keccak to the trust anchor's list
                    //@note:@here:@todo: not checking bounds.. will this be an issue?
                    trustAnchorAddress_to_attestationKeccakArray[msg.sender].push(attestationKeccak);
                    //create a attestation keccak to end-user mapping
                    attestationKeccak_to_identifiedAddress[attestationKeccak] = _identifiedAddress;
                    //add the attestation keccak to the users's list
                    //@note:@here:@todo: not checking bounds.. will this be an issue?
                    attestationKeccak_to_identifiedAddressAttestationKeccakArrayIndex[attestationKeccak] = uint16(identifiedAddress_to_attestationKeccakArray[_identifiedAddress].length);
                    identifiedAddress_to_attestationKeccakArray[_identifiedAddress].push(attestationKeccak);

                    //attestation set
                    return (3, attestationKeccak);
                } else {
                    emit EVT_AttestationAlreadyExists(msg.sender, _identifiedAddress, attestationKeccak);
                    //attestation already exists
                    return (2, 0);
                }
            } else {
                emit EVT_AttestationNotValid(msg.sender, _identifiedAddress, attestationKeccak, _publicData.length, _documentsMatrixEncrypted.length, _availabilityAddressEncrypted.length);

                //attestation not valid
                return (1, 0);
            }
        } else {
            //trust anchor is not verified
            return (0, 0);
        }
    }

    //@note:@todo:@critical: there is a differentiation of the "current" and "original" identified address.. the case where we'd
    // want to be able to have trust anchors update the identified address of an attestation is a useful one in context where there
    // is a need to change identity data (either on behalf of or directed by a user), to recover attestations for example.

    /// @param _identifiedAddress The end user's smart contract address that is being attested to.
    /// @param _trustAnchorAddress The trust anchor that this attestation is being created by.
    /// @param _jurisdiction The jurisdiction of the attestation (may be different than the Trust Anchor's jurisdiction).
    /// @param _effectiveTime The effective (start) time of the attestation (in Seconds from Unix Epoch Time).
    /// @param _expiryTime The expiry time of the attestation (in Seconds from Unix Epoch Time).
    /// @param _publicData Any non-PII public metadata (hash codes from the Trust Anchor, etc.)
    /// @param _documentsMatrixEncrypted The document matrix, a series of 0's and 1's corresponding to the availability of specific pieces of "hard" documentation that the Trust Anchor holds. Generally encrypted via symmetric AES to prevent abstracted PII from being leaked on the blockchain directly.
    /// @param _availabilityAddressEncrypted The availability address, an ethereum-type address corresponding to the smart contract that manages the various economic & regulatory conditions of data transfer from a Trust Anchor to a data retriever. Generally encrypted via symmetric AES to prevent abstracted PII from being leaked on the blockchain directly.
    /// @param _isManaged Whether this attestation is managed by the Trust Anchor. This indicates that consent conditions are applied from the Trust Anchor instead of the end user.
    /// @dev | Internally creates the attestation for a specific Shyft end-user, sent by a (Verified) Trust Anchor. Internally called from "setAttestation".

    function createAttestation( bytes32 _attestationKeccak,
                                address _trustAnchorAddress,
                                address _identifiedAddress,
                                uint16 _jurisdiction,
                                uint64 _effectiveTime,
                                uint64 _expiryTime,
                                bytes memory _publicData,
                                bytes memory _documentsMatrixEncrypted,
                                bytes32 _availabilityAddressEncrypted,
                                bool _isManaged) internal {
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        trustAnchorAttestation storage newAttestation = attestationKeccak_to_attestation[_attestationKeccak];

        newAttestation.attestationStatusApproved = (_effectiveTime <= block.timestamp && (_expiryTime == 0 || _expiryTime > block.timestamp));

        newAttestation.trustAnchorAddress = _trustAnchorAddress;
        newAttestation.trustAnchorIndex = trustAnchorManager.getTrustAnchorIndex(msg.sender);
        newAttestation.identifiedAddress = _identifiedAddress;
        newAttestation.jurisdiction = _jurisdiction;
        newAttestation.effectiveTime = _effectiveTime;
        newAttestation.expiryTime = _expiryTime;
        newAttestation.publicData = _publicData;

        newAttestation.documentsMatrixEncrypted = _documentsMatrixEncrypted;
        newAttestation.availabilityAddressEncrypted = _availabilityAddressEncrypted;

        newAttestation.isManaged = _isManaged;

        newAttestation.identifiedAddressToTrustAnchorDataRetrievalRevenueShare = identifiedAddress_to_trustAnchor_to_dataRetrievalRevenueShare[_identifiedAddress][_trustAnchorAddress];

        postAttestationEvent(   _attestationKeccak,
                                _trustAnchorAddress,
                                _identifiedAddress,
                                _jurisdiction,
                                _effectiveTime,
                                _expiryTime,
                                _publicData,
                                _documentsMatrixEncrypted,
                                _availabilityAddressEncrypted,
                                _isManaged);
    }

    /// @param _identifiedAddress The end user's smart contract address that is being attested to.
    /// @param _trustAnchorAddress The trust anchor that this attestation is being created by.
    /// @param _jurisdiction The jurisdiction of the attestation (may be different than the Trust Anchor's jurisdiction).
    /// @param _effectiveTime The effective (start) time of the attestation (in Seconds from Unix Epoch Time).
    /// @param _expiryTime The expiry time of the attestation (in Seconds from Unix Epoch Time).
    /// @param _publicData Any non-PII public metadata (hash codes from the Trust Anchor, etc.)
    /// @param _documentsMatrixEncrypted The document matrix, a series of 0's and 1's corresponding to the availability of specific pieces of "hard" documentation that the Trust Anchor holds. Generally encrypted via symmetric AES to prevent abstracted PII from being leaked on the blockchain directly.
    /// @param _availabilityAddressEncrypted The availability address, an ethereum-type address corresponding to the smart contract that manages the various economic & regulatory conditions of data transfer from a Trust Anchor to a data retriever. Generally encrypted via symmetric AES to prevent abstracted PII from being leaked on the blockchain directly.
    /// @param _isManaged Whether this attestation is managed by the Trust Anchor. This indicates that consent conditions are applied from the Trust Anchor instead of the end user.
    /// @dev Emits the "setAttestation" event with enough variables to fully inform a watcher of a new attestations variables and state. Internally called from "createAttestation". While it may seem strange to have a function dedicated to a single event emission, this is a firm requirement due to the call depth stack of the ethereum EVM.

    function postAttestationEvent(  bytes32 _attestationKeccak,
                                    address _trustAnchorAddress,
                                    address _identifiedAddress,
                                    uint16 _jurisdiction,
                                    uint64 _effectiveTime,
                                    uint64 _expiryTime,
                                    bytes memory _publicData,
                                    bytes memory _documentsMatrixEncrypted,
                                    bytes32 _availabilityAddressEncrypted,
                                    bool _isManaged) internal {
        if (_publicData.length > 0) {
            // emit event related to the setting of this attestation.
            emit EVT_setAttestation(_attestationKeccak,
                _trustAnchorAddress,
                _identifiedAddress,
                _jurisdiction,
                _effectiveTime,
                _expiryTime,
                bytes32(_publicData[0]),
                bytes32(_documentsMatrixEncrypted[0]),
                _availabilityAddressEncrypted,
                _isManaged,
                _publicData.length,
                _documentsMatrixEncrypted.length);
        } else {
            // emit event related to the setting of this attestation.
            emit EVT_setAttestation(_attestationKeccak,
                _trustAnchorAddress,
                _identifiedAddress,
                _jurisdiction,
                _effectiveTime,
                _expiryTime,
                "",
                bytes32(_documentsMatrixEncrypted[0]),
                _availabilityAddressEncrypted,
                _isManaged,
                _publicData.length,
                _documentsMatrixEncrypted.length);
        }
    }

    //@note:@here:@todo:@next:@critical: in the case where consent has changed, there should be a method of updating (appending to the "consented" trust channel mappings for instance) the associated attestations.
    // otherwise, compiling a non-consented (yet) attestation will prevent the compilation to the consented channels.

    //@note: this attestation has the consent of the trust anchor to be published.
    // causes a secondary consented attestation and the ability of this to be published on the fully consented trust
    // channel rails.

    /// @param _attestationKeccak The attestation's keccak hash.
    /// @param _attestationValidityTrustAnchorSignatureV Part of the Trust Anchor's signature that is used by the ecrecover function to validate the signature.
    /// @param _attestationValidityTrustAnchorSignatureRS Part of the Trust Anchor's signature that is used by the ecrecover function to validate the signature.
    /// @dev | Provides a valid signature from the Trust Anchor, for a specific attestation. With the Trust Anchor's signature, allows the attestation to be considered fully consented on the Trust Channel architecture.
    /// @return result
    ///    | 0 = sender is not the trust anchor address that created this attestation
    ///    | 1 = already signed
    ///    | 2 = invalid signature
    ///    | 3 = stored valid signature

    function signAttestationTrustAnchorSignature(bytes32 _attestationKeccak,
                                                 uint8 _attestationValidityTrustAnchorSignatureV,
                                                 bytes32[2] memory _attestationValidityTrustAnchorSignatureRS) public override returns (uint8 result) {
        trustAnchorAttestation storage attestation = attestationKeccak_to_attestation[_attestationKeccak];

        if (attestation.trustAnchorAddress == msg.sender) {
            if (attestation.attestationValidityTrustAnchorSignatureRS[0] != 0) {
                bytes32 attestationAndTrustAnchorAddressKeccak = keccak256(abi.encodePacked(_attestationKeccak, msg.sender));

                address recoveredAddress = ecrecover(attestationAndTrustAnchorAddressKeccak, _attestationValidityTrustAnchorSignatureV, _attestationValidityTrustAnchorSignatureRS[0], _attestationValidityTrustAnchorSignatureRS[1]);
                // address recoveredAddress = ECRecovery.recover(_attestationKeccak, _attestationValidityTrustAnchorSignature);
                // this should recover the trust anchor's address, but this is encrypted...
                if (recoveredAddress == msg.sender) {
                    attestation.attestationValidityTrustAnchorSignatureV = _attestationValidityTrustAnchorSignatureV;
                    attestation.attestationValidityTrustAnchorSignatureRS = _attestationValidityTrustAnchorSignatureRS;

                    attestation.consentAvailable++;

                    //stored valid signature
                    return 3;
                } else {
                    //invalid signature
                    return 2;
                }
            } else {
                //already signed
                return 1;
            }
        } else {
            //sender is not the trust anchor address that created this attestation
            return 0;
        }
    }

    /// @param _attestationKeccak The attestation's keccak hash.
    /// @param _attestationValidityUserSignatureV Part of the end user's signature that is used by the ecrecover function to validate the signature.
    /// @param _attestationValidityUserSignatureRS Part of the end user's signature that is used by the ecrecover function to validate the signature.
    /// @dev | Provides a valid signature from the end user, for a specific attestation. With the Trust Anchor's signature, allows the attestation to be considered fully consented on the Trust Channel architecture.
    ///      | One of the uses of this is to prevent spam attestations from being considered on the consented rails.
    /// @return result
    ///    | 0 = sender is not the user address that is associated with this attestation
    ///    | 1 = already signed
    ///    | 2 = invalid signature
    ///    | 3 = stored valid signature

    function signAttestationUserSignature(bytes32 _attestationKeccak,
        uint8 _attestationValidityUserSignatureV, bytes32[2] memory _attestationValidityUserSignatureRS) public override returns (uint8 result) {
        trustAnchorAttestation storage attestation = attestationKeccak_to_attestation[_attestationKeccak];

        if (attestation.identifiedAddress == msg.sender) {
            if (attestation.attestationValidityUserSignatureRS[0] != 0) {
                bytes32 attestationAndUserAddressKeccak = keccak256(abi.encodePacked(_attestationKeccak, msg.sender));

                address recoveredAddress = ecrecover(attestationAndUserAddressKeccak, _attestationValidityUserSignatureV, _attestationValidityUserSignatureRS[0], _attestationValidityUserSignatureRS[1]);
                // address recoveredAddress = ECRecovery.recover(_attestationKeccak, _attestationValidityTrustAnchorSignature);
                // this should recover the trust anchor's address, but this is encrypted...
                if (recoveredAddress == msg.sender) {
                    attestation.attestationValidityUserSignatureV = _attestationValidityUserSignatureV;
                    attestation.attestationValidityUserSignatureRS = _attestationValidityUserSignatureRS;

                    attestation.consentAvailable++;

                    //stored valid signature
                    return 3;
                } else {
                    //invalid signature
                    return 2;
                }
            } else {
                //already signed
                return 1;
            }
        } else {
            //sender is not the user address that is associated with this attestation
            return 0;
        }
    }

