    /// @param _attestationKeccak The attestation's keccak hash.
    /// @param _identifiedAddress The end user's smart contract address that this attestation is associated to.
    /// @param _documentsMatrixEncrypted The document matrix, a series of 0's and 1's corresponding to the availability of specific pieces of "hard" documentation that the Trust Anchor holds. Generally encrypted via symmetric AES to prevent abstracted PII from being leaked on the blockchain directly.
    /// @param _availabilityAddressEncrypted The availability address, an ethereum-type address corresponding to the smart contract that manages the various economic & regulatory conditions of data transfer from a Trust Anchor to a data retriever. Generally encrypted via symmetric AES to prevent abstracted PII from being leaked on the blockchain directly.
    /// @dev | Does a verification pass on the attestation, checks for attestation and end user address validity, as well as the document matrix and availability address being set.
    /// @return result
    ///    | false = not valid
    ///    | true = valid attestation

    function verifyAttestationValidity( bytes32 _attestationKeccak,
                                        address _identifiedAddress,
                                        bytes memory _documentsMatrixEncrypted,
                                        bytes32 _availabilityAddressEncrypted) internal pure returns (bool result) {
        if (_attestationKeccak != 0 &&
            _identifiedAddress != address(0) &&
            _documentsMatrixEncrypted.length != 0 &&
            _availabilityAddressEncrypted != 0) {
            //valid attestation
            return true;
        } else {
            //not valid
            return false;
        }
    }

    //@note:@todo:@internalaudit:@review: what happens when a TA's attestation key is revoked.. should they still be allowed
    // to revoke attestations?

    /// @param _attestationKeccak The attestation's keccak hash.
    /// @dev | Revokes an attestation. Can be called by the Trust Anchor that initially set this attestation, and the Prime Revocation Manager (for edge-case events where the Trust Anchor is no longer able to manage attestations).
    ///      | This function calls the linked Shyft Cache Graph to update the Trust Channel architecture.
    /// @return result
    ///    | 0 = revocation authority not recognized
    ///    | 1 = no non-revoked attestation found
    ///    | 2 = attestation revoked

    function revokeAttestation(bytes32 _attestationKeccak) public override returns (uint8 result) {
        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        trustAnchorAttestation storage attestation = attestationKeccak_to_attestation[_attestationKeccak];

        //@note:@todo:@internalaudit: should trust anchors that have been revoked be able to revoke previously signed
        // messages? currently set to only currently verified anchors having the ability to revoke.

        bool anchorVerified = false;
        emit EVT_REQ_revokeAttestation(msg.sender, _attestationKeccak);
        if (isTrustAnchorVerified(msg.sender)) {
            anchorVerified = true;
        }

        if ((attestation.trustAnchorAddress == msg.sender && anchorVerified) || trustAnchorManager.isPrimeRevocationManager(msg.sender)) {
            emit EVT_revokeAttestation( _attestationKeccak,
                attestation.trustAnchorAddress,
                attestationKeccak_to_identifiedAddressAttestationKeccakArrayIndex[_attestationKeccak],
                trustAnchorManager.isPrimeRevocationManager(msg.sender));

            if (attestation.identifiedAddress != address(0) &&
                attestation.attestationStatusApproved == true) {

                attestation.attestationStatusApproved = false;

//                EVT_revokeAttestationDoRecompile(shyftCacheGraphAddress);

                //recompile cache graph of the identifiedAddress that would depend on this attestation.
                IShyftCacheGraph shyftCacheGraph = IShyftCacheGraph(shyftCacheGraphAddress);

                shyftCacheGraph.compileCacheGraph(attestation.identifiedAddress,
                    attestationKeccak_to_identifiedAddressAttestationKeccakArrayIndex[_attestationKeccak]);

                //attestation revoked
                return 2;
            } else {
                //no non-revoked attestation found
                return 1;
            }
        } else {
            //revocation authority not recognized
            return 0;
        }
    }

