    /// @param _attestationKeccak The attestation's keccak hash.
    /// @param _dataRetrievalTarget The public address of the Trust Anchor that is doing the data retrieval.
    /// @param _documentsRetrievalConsentedEncrypted The document matrix of the data that is consented to be able to be retrieved by the Trust Anchor that is performing the data retrieval. This is a series of 0's and 1's corresponding to the availability of specific pieces of "hard" documentation that the Trust Anchor holds. Generally encrypted via symmetric AES to prevent abstracted PII from being leaked on the blockchain directly.
    /// @dev | Enables and provides parameters to the data that is consented to be retrieved by the target Trust Anchor.
    ///      | This function is called by the Trust Anchor as it is in the Managed context.
    /// @notice _dataRetrievalTarget needs to be a verified Trust Anchor.
    /// @return result
    ///    | 0 = trust anchor is not verified
    ///    | 1 = data retrieval target trust anchor is not verified
    ///    | 2 = attestation is not managed by trust anchor
    ///    | 3 = not the trust anchor address that created this attestation
    ///    | 4 = attestation already has this data retrieval target
    ///    | 5 = data retrieval target set

    function addDataRetrievalTargetManaged( bytes32 _attestationKeccak,
                                            address _dataRetrievalTarget,
                                            bytes memory _documentsRetrievalConsentedEncrypted) public override returns (uint8 result) {
        if (isTrustAnchorVerified(msg.sender)) {
            if (isTrustAnchorVerified(_dataRetrievalTarget)) {
                trustAnchorAttestation storage attestation = attestationKeccak_to_attestation[_attestationKeccak];
                if (attestation.isManaged == true) {
                    if (attestation.trustAnchorAddress == msg.sender) {
                        if (attestation.dataRetrievalTargetsRetrievableData[_dataRetrievalTarget].isRetrievable != true) {
                            attestation.dataRetrievalTargetsRetrievableData[_dataRetrievalTarget].isRetrievable = true;
                            attestation.dataRetrievalTargetsRetrievableData[_dataRetrievalTarget].documentsRetrievalConsentedEncrypted = _documentsRetrievalConsentedEncrypted;
                            attestation.dataRetrievalTargetsArray.push(_dataRetrievalTarget);

                            emit EVT_enabledDataRetrievalManaged(msg.sender, _attestationKeccak, _dataRetrievalTarget, _documentsRetrievalConsentedEncrypted);

                            //data retrieval target set
                            return 5;
                        } else {
                            //attestation already has this data retrieval target
                            return 4;
                        }
                    } else {
                        //not the trust anchor address that created this attestation
                        return 3;
                    }
                } else {
                    //attestation is not managed by trust anchor
                    return 2;
                }
            } else {
                //data retrieval target trust anchor is not verified
                return 1;
            }
        } else {
            //trust anchor is not verified
            return 0;
        }
    }

