    /// @param _attestationKeccak The attestation's keccak hash.
    /// @param _dataRetrievalTarget The public address of the Trust Anchor that is doing the data retrieval.
    /// @dev | Indicates that the source trust anchor has sent the data/documents (example usage: for the contestation phase in an escrow "availability" contract) to the data retrieval entity.
    ///      | This function is called by the source trust anchor that has the user's PII data, on an attestation that has already been permissioned to a data retrieval entity.
    /// @return result
    ///    | 0 = message sender is not the trust anchor that originally set this attestation
    ///    | 1 = data is not set to retrievable with that data retrieval target
    ///    | 2 = data was already marked as sent
    ///    | 3 = data is now marked as sent

    function setDataSenderDidSendDocuments(bytes32 _attestationKeccak, address _dataRetrievalTarget) public returns (uint8 result) {
        trustAnchorAttestation storage attestation = attestationKeccak_to_attestation[_attestationKeccak];

        if (attestation.trustAnchorAddress == msg.sender) {
            if (attestation.dataRetrievalTargetsRetrievableData[_dataRetrievalTarget].isRetrievable == true) {
                if (attestation.dataRetrievalTargetsRetrievableData[_dataRetrievalTarget].wasSent == false) {
                    attestation.dataRetrievalTargetsRetrievableData[_dataRetrievalTarget].wasSent = true;

                    // timestamp this data for further use re: contestation time periods.
                    attestation.dataRetrievalTargetsRetrievableData[_dataRetrievalTarget].timestampSent = block.timestamp;


                    //data is now marked as sent
                    return 3;
                } else {
                    //data was already marked as sent
                    return 2;
                }
            } else {
                //data is not set to retrievable with that data retrieval target
                return 1;
            }
        } else {
            //message sender is not the trust anchor that originally set this attestation
            return 0;
        }
    }

