    //@note: what if we were to generalize this and set up an automatic trigger to be sent to the
    // availabilityAddressEncrypted smart contract for automatic escrow releasing?
    // this would be difficult to do unless either:
    // a) isn't encrypted or b) the encryption key is passed at some point to the blockchain for
    // automatic decryption (which would be expensive).
    //
    // so instead, we have added a function getAttestationValidFromRetrieverInKeccakArray() to perform
